    {
     "type": "html",
     "name": "question70",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Please contact the investigator for questions, problems or concerns about the research. Their contact information is on page 1 of this form. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You might have feedback, questions, problems, concerns or want to obtain more information about this study. If so, you can talk with someone who is not part of this study by contacting:</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Cedars-Sinai Human Research Protection Program (HRPP) </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Phone: 310-423-3783 </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Email: <u>ResearchConcerns@cshs.org</u> </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Website: cedars-sinai.org/research/administration/office-of-research-compliance/review-board.html</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The Cedars-Sinai HRPP protects the rights and welfare of research participants.</p>\n"
    }
   ],
