     "html": "<h4 style=\"text-align:center\"><b>\nSignature Page</b></h4>\n\n<h4 style=\"text-align:center\"><b>\nConsent Form for Research</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree to take part in this study, you should sign and date on the signature lines below. You will be given a signed and dated copy of this form. This includes the “Experimental Subject’s Bill of Rights” and any optional sub-study descriptions, when applicable.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Signature by the Participant</b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Main Research Study:</b> <i>I agree to take part in the research study described to me during the informed consent process and described in this informed consent form. My questions have been answered to my satisfaction.</i></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>You will be given a signed and dated copy of this form.</b></p>"
