    {
     "type": "html",
     "name": "question5",
     "maxWidth": "600px",
     "html": "\n<h3 style=\"text-align:center;font-size:24px\"> <b><u>AUTHORIZATION FOR USE AND DISCLOSURE OF IDENTIFIABLE HEALTH INFORMATION FOR RESEARCH</u></b></h3> \n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>1.   USE AND DISCLOSURE OF HEALTH INFORMATION</b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree to this Authorization, you give permission to theSponsor, Principal Investigator, otherinvestigators and their research team described in the Consent Form for Research(“Research Team”) to use or disclose your identifiable health information (“private information”) for the research study titled “The HEALthy Brain and Child Development Study (HBCD)” which is described in the Consent Form for Research (“Consent Form”) to which this Authorization is attached. In particular, you authorize the research team acting under the direction of the Principal Investigator to review your medical recordsand collect your private information from the following sources:</p>"
    },
