     "type": "html",
     "name": "question8",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>2.   WHO WILL HAVE ACCESS TO YOUR PRIVATE INFORMATION?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Your private information will be used by and/or shared with the Research Team</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In addition to the research team, if applicable, the following parties may receive your private information and inspect your records: </p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>The reviewing Institutional Review Boards and Cedars-Sinai offices with authority to oversee research compliance.</li>\n<li>U.S. government agencies, such as the Food and Drug Administration and the Department of Health and Human Services.</li>\n<li>Researchers at other organizations who are participating in this research study.</li>\n<li>The Study Sponsor, its business partners, and Cedars-Sinai’s business partners for matters related to research study oversight, conduct of the research, data analysis, use of research results in product development, and payment or reimbursement.</li>\n<li>Representatives from regulatory agencies in other countries may join in the review of your research records, including research-related medical reports and information, with the Sponsor and/or the FDA.</li>\n</ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Cedars-Sinai takes steps to protect your private information when sharing it with the recipients described above. Though these steps and applicable law are meant to protect your private information, there is a risk that a recipient could share your private information without your permission.</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>3.   WHEN WILL MY AUTHORIZATION EXPIRE?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">By signing this document, you authorize the use and sharing of your private information until the end of the research studyand any related optional sub-study you choose to participate in.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page25",
   "elements": [
    {
     "type": "html",
     "name": "question69",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>4.   REVOKING AUTHORIZATION</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may change your mind and revoke (take back) this Authorization at any time.  Even if you revoke this Authorization, the research team may still use or disclose private information they already have obtained about you as necessary to maintain the integrity or reliability of the current research. To revoke this Authorization, you must write to the Principal Investigator of the research study by writing to the Office of Research Compliance and Quality Improvement,6500 Wilshire Blvd., Suite 1800, Los Angeles, Calif.  90048 and/or emailing to ResearchConcerns@cshs.org.\n</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>5.   NOTICE OF RIGHTS AND OTHER INFORMATION</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You do not have to agree to this Authorization, but if you do not agree, you may not participate in the research study. Cedars-Sinai may not condition (withhold or refuse) the provision of standard of care treatment for you on whether you agree to this Authorization.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree to this Authorization, please sign on the appropriate signature line below. You will receive a copy of this Authorization.</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>6. OPTIONAL SUB-STUDY</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In addition to the main research study, you have the option to agree to participate in one or more optional sub-studies as explained to you during the informed consent process. Your decision to take part in the optional sub-study(ies) does not impact your ability to participate in the main research study. </p>\n\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree that your identifiable health information may be used and/or disclosed for the optional sub-study described in the informed consent process and above, you will be required to sign a second time in the signature section.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
