     "type": "html",
     "name": "question77",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\"><b>Signature by the Interpreter/Witness</b></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><i>(Signature of an interpreter is only required when enrolling a non-English-speaking subject with the assistance of an interpreter and IRB-approved “short form” consent processes. The witness may be any person who is conversant in both English and the language of the non-English-speaking subject, such as a certified hospital interpreter, study staff, a family member or other person. The witness signs the consent forms to confirm that the oral interpretation occurred.</i></p>\n\n<p style=\"text-align:left;color:black;font-size:16px;padding-bottom:80px\"><i>Signature of a witness is required when an English-speaking subjects who has been determined to have capacity to consent is unable to read or physically sign the consent form, but choses to indicate via a “mark” or verbally that he/she agrees to participate. The witness signs the consent form to confirm that an oral consent process occurred and that the individual verbally consented to participate in the research.)</i></p>"
    },
